import React from 'react'
import classes from './Input.module.css';

 const Input = ({label,id, type, placeholder}) => {
  return (
    <div className={classes.controls}>
      <label htmlFor={'id'}> {label} </label>
      <input 
       id={id}
       type={type}
       name={type} 
       placeholder={placeholder} />
    </div>  
  )
}

export default Input;
